import React from 'react';
import { useNavigate } from 'react-router-dom';

const NavigateToRoot = () => {
  const navigate = useNavigate();
  React.useEffect(() => navigate('/node/1'), [navigate]);
  return null;
};

export default NavigateToRoot;
